import { Link } from 'react-router-dom';
import React from 'react';
import './Nav.css';

function Nav(){
    return(
        <div>
            <div className='navbar'>
                <Link className="navbarMenu" to={'/'}>회원 관리</Link>
                <Link className="navbarMenu" to={'/'}>실시간 수영장</Link>
                <Link className="navbarMenu" to={'/'}>관리자 설정</Link>
            </div>
        </div>
    )
}

export default Nav;
